.: Plot :.

From writer/executive producer Jason Katims (Friday Night Lights) -- this contemporary re-imagining of the blockbuster film depicts the colorful and imperfect Braverman family -- four grown siblings sharing the headaches, heartaches and joy of being parents. The star-studded cast includes Peter Krause, Maura Tierney, Craig T. Nelson, Dax Shepard, Bonnie Bedelia, Monica Potter, Erika Christensen and Sarah Ramos. When Sarah Braverman, a financially strapped single mother, returns home to her parents and siblings in Berkeley, Calif. after packing up her Fresno apartment and uprooting her two inconvenienced kids, Amber (Mae Whitman) and Drew (Miles Heizer), she is greeted by her opinionated father, Zeek (Nelson), and strong mother, Camille (Bedelia) who are privately dealing with their own marital issues. As Sarah is reunited with her siblings -- sister, Julia (Christensen), and brothers Crosby (Shepard) and Adam (Krause) -- all struggling with issues of their own, it's clear that the Braverman reunion is just what they need to face the everyday challenges of modern family life.

